import Col from "react-bootstrap/Col";
const Styles = styled.div`
  .main-special {
    position: relative;
    height: 36vh;
    width: 100%;
    background: #567786;
    cursor: pointer;
    overflow: hidden;
    // padding-top: 2%;
    // padding-bottom: 2%;
  }
  .header {
  }
  .textContainer {
    justify-content: center;
    padding-top: 5%;
    padding-bottom: 5%;
  }
  .text {
    font-family: "Open Sans";
  }
`;

const Banner = () => {

  return (
      <Fragment>

    <Styles> 
   <div className="header"> 
   <Container 
   fluid 
   style={{width:"100%", padding:"0",background:"red"}}> 
    {/* <img src={bannerpic1} alt="React Logo"  /> */}

<Row>     <Col xs={0} sm={0} md={1} lg={0} xl={2}></Col>
</Row>
    <Row>
    <Col xs={0} sm={0} md={1} lg={0} xl={2}></Col>
       <h1> TravelBuddy </h1> 

       </Row>

       <Row>
       <Col xs={0} sm={0} md={1} lg={0} xl={2}></Col>

       <h3> The internet's source for the best flights. </h3> 
       </Row>
  </Container>
   </div>
   </Styles> 

   </Fragment>
  );
};

export default Banner;
